import React from 'react'
import Navbar from '../components/navbar/navbar'
import Sidebar from '../components/sidebar/sidebar'

const sidebar_options = {
    block1: {
        title: 'Add Movie',
        subtitle: 'Options'
    },
    marginTop: {
        marginTop: "3vh"
    }
}

const CreateMovie = () => {
    return(
    <div>
        <Navbar />
        <Sidebar input={sidebar_options}/>
    </div>
    );
}


export default CreateMovie
